import React from "react"
import ReactDOM from "react-dom"
import "./styles.css"

function primeirJSX(){
    return(
        <div>
            Ramon Oliveira - Introdução ao React JS
        </div>
    )
}

const App = () => {
    return(
        <div className="App">
            {primeirJSX}
        </div>
    )
}

const rootElement = document.getElementById("root")
ReactDOM.render(<App />, rootElement)
